import React from 'react';
import './style.scss'
import { FaUserAlt, FaEnvelope, FaPhoneAlt, FaMapMarkerAlt, FaSkype } from "react-icons/fa";

const aboutData = [
    {
        text: 'ABOUT',
    },
    {
        text: 'Alexandr Zhuk',
    },
    {
        text: 'FRONT-END DEVELOPER (REACT.JS)',
    },
    {
        text: 'Hello! I\'m Alexandr Zhuk Front-End Developer. I like to do web development, as well as ' +
            'develop new projects in a team. I plan to develop in this industry and improve my qualifications',
    },
]

const contactsData = [
    {
        text: 'CONTACTS:',
    },
    {
        icon: <FaUserAlt/>,
        text: 'Name: Alexandr Zhuk',
    },
    {
        icon: <FaEnvelope/>,
        text: 'E-mail: sasha20013zhuk@gmail.com:',
    },
    {
        icon: <FaPhoneAlt/>,
        text: 'Phone: +(380)-97-922-29-30',
    },
    {
        icon: <FaMapMarkerAlt/>,
        text: 'Address: Kiev, Ukraine',
    },
    {
        icon: <FaSkype/>,
        text: 'Skype: sanek10582',
    },
    {
        text: 'Download CV',
    },
]

const About = () => {
    const contacts =
        <div className='contacts'>
            {contactsData.map(({ icon, text }) => <div>{icon && icon} {`${text}`}</div>)}
        </div>

    const technical =
    <div className='technical'>
        <div>Technical Skills:</div>
        <div>HTML5</div>
        <div>CSS3</div>
        <div>JavaScript</div>
        <div>React</div>
        <div>Redux</div>
        <div>Jira</div>
        <div>GitHub</div>
        <div>GitLab</div>
        <div>SASS and LESS</div>
    </div>
    return (
        <div className='about'>
            <div className='about-info'>
                {aboutData?.map(({ text }) => <div>{text}</div>)}
            </div>
            <div className='contacts-info'>
                {contacts}
                {technical}
            </div>
        </div>
    );
};

export default About;
